import photo_1 from "../../img/ham/photo-1.jepg";
import photo_2 from "../../img/ham/photo-2.jepg";
import photo_3 from "../../img/ham/photo-3.jepg";
import photo_4 from "../../img/ham/photo-3.jepg";
const Ham = () => {
  const images = [
    {
      src: photo_1,
      text: " Nakivubo Stadium",
    },
    {
      src: photo_2,
      text: " GreenHill Academy",
    },
    {
      src: photo_3,
      text: " Pentecostal Church",
    },
    {
      src: photo_4,
      text: " NOL-PJ",
    },
  ];

  return (
    <div className="projects">
      <div className="container">
        <div className="projects-flex">
          {images.map((image, index) => {
            return (
              <div className="project-item " key={index}>
                <figure>
                  <img src={image.src} alt="" />
                  <figcaption>
                    <h3>{image.text}</h3>
                  </figcaption>
                </figure>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};
export default Ham;
